"use client";

import Link from "next/link";
import { useState, useEffect } from "react";

export default function SuccessPage() {
  const [data, setData] = useState<any>(null);

  useEffect(() => {
    const saved = sessionStorage.getItem("applicationData");
    if (saved) setData(JSON.parse(saved));
  }, []);

  if (!data) return <div>Loading...</div>;
  console.log(data);

  return (
    <div className='bg-[#FFFFFF] font-[Fustat] min-h-screen'>
      {/* Navbar */}
      <div className='nav bg-white'>
        <div className='mx-10 flex items-center justify-between py-10 md:px-0'>
          <div className='flex items-center space-x-6'>
            <Link
              href='/'
              className='text-4xl font-semibold'>
              INTERNPLUS
            </Link>

            {/* Language dropdown */}
            <div className='relative'>
              {/* We'll use a small React state for the dropdown */}
              <LanguageDropdown />
            </div>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className='w-full flex flex-col items-center justify-center my-10 space-y-6'>
        <div className='w-[90%] success-card flex flex-col items-center p-10 rounded-lg bg-[#F3F5FC]'>
          <div className='img'>
            <svg
              width='285'
              height='285'
              viewBox='0 0 285 285'
              fill='none'
              xmlns='http://www.w3.org/2000/svg'
              xmlnsXlink='http://www.w3.org/1999/xlink'>
              <rect
                width='285'
                height='285'
                fill='url(#pattern0_6_31912)'
              />
              <defs>
                <pattern
                  id='pattern0_6_31912'
                  patternContentUnits='objectBoundingBox'
                  width='1'
                  height='1'>
                  <use
                    xlinkHref='#image0_6_31912'
                    transform='scale(0.000976562)'
                  />
                </pattern>
                <image
                  id='image0_6_31912'
                  width='1024'
                  height='1024'
                  preserveAspectRatio='none'
                  xlinkHref='data:image/png;base64,'
                />
              </defs>
            </svg>
          </div>
          <div className='font-extrabold uppercase mb-3 text-2xl'>
            application successful
          </div>
          <div className='text text-center text-[#323438] text-sm'>
            We have received your application! <br />
            Please wait to proceed to the next step in a few days <br />
            and your application ID is
          </div>
          <div className='id my-10 text-2xl font-extrabold'>
            {data.application_id}
          </div>
          <div
            className='login-button border rounded py-2 px-5 cursor-pointer text-white bg-[#474BC2] hover:bg-[#F3F5FC] hover:text-[#474BC2] transition'
            onClick={() => (window.location.href = "/application")}>
            Go to Application page
          </div>
        </div>
      </div>
    </div>
  );
}

function LanguageDropdown() {
  const [open, setOpen] = useState(false);

  return (
    <div className='relative'>
      <button
        onClick={() => setOpen(!open)}
        className='flex items-center space-x-1 text-xl font-medium'>
        <span className='opacity-70'>EN</span>
        <svg
          className='w-4 h-4'
          fill='none'
          stroke='currentColor'
          viewBox='0 0 24 24'>
          <path
            strokeLinecap='round'
            strokeLinejoin='round'
            strokeWidth='2'
            d='M19 9l-7 7-7-7'
          />
        </svg>
      </button>
      {open && (
        <ul className='absolute z-10 mt-1 bg-white border border-gray-200 rounded shadow w-28 text-xl text-gray-700'>
          <li>
            <Link
              href='#'
              className='block px-3 py-2 hover:bg-gray-100'>
              English
            </Link>
          </li>
          <li>
            <Link
              href='#'
              className='block px-3 py-2 hover:bg-gray-100'>
              ภาษาไทย
            </Link>
          </li>
        </ul>
      )}
    </div>
  );
}
